import React from 'react';
import {StyledHold} from './styles/StyledHold';
import {StyledStage} from './styles/StyledStage';
import Cell from './Cell';

const Hold = ({hold, text}) => (
    <StyledHold> 
        {console.log(hold)}
        <StyledStage width={hold.length} height={hold.length}>
            {hold.tetromino.map(row => row.map((cell, x) => <Cell key={x} type={cell[0]} />))}
        </StyledStage>
    </StyledHold>
)

export default Hold;
